import React, {useState} from 'react';
import About from './Components/About';
import Home from './Components/Home';
import Contact from './Components/Contact';
const App = () => {
  var [about,setAbout]= useState(false);
  const aboutpage = () => {
    setAbout(!about);
  };

  var [contact,setContact]= useState(false);
  const contactpage = (about) => {
    setContact(!about);
  };


    if (about) {
      return(
        <div>
          <About/>
          <button onClick={about=false}>CLick me to go back</button>
        </div>
      )
    }

    if (contact) {
      return(
        <div>
          <Contact/>
          <button onClick={contact=false}>CLick me to go back</button>
        </div>
      )
    }


    return(
      <div>
        <Home/>
        <button onClick={aboutpage}>About</button>
        <button onClick={contactpage(about)}>Contact</button>
      </div>
    )
}

export default App;
